(7963, 152, 0, 1, 'Say Hello!!!(熱)', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'Say Hello!!!\r\n曲：Ian&Tzara 詞：Tzara 編曲：FLAT CLUB\r\n\r\n\r\n如今你愣在轉角\r\n十一點鍾座標\r\n再不轉向恐怕船就要觸礁\r\n\r\n\r\n所以別投鼠忌器\r\n自顧不瑕緊張\r\n扭扭捏捏結結巴巴語焉不詳\r\n\r\nSay Hello Honey\r\nSay Hello Baby\r\nSay Hello lovery\r\nSay Hello sweetie\r\n\r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架(自拔)\r\n\r\n(廢話我也不想多嘮叨)\r\n可是你拐彎抹角\r\n面有難色尷尬\r\n欲言又止一點也不瀟灑大方\r\n\r\n\r\n還是想懸崖勒馬\r\n矜持不可自拔\r\n眼高手低吞吞吐吐失措慌張\r\n\r\nSay Hello Honey\r\nSay Hello Baby\r\nSay Hello lovery\r\nSay Hello sweetie\r\n\r\n\r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架(自拔)\r\n\r\n\r\ns\r\n所以你懂嗎\r\n現在的樣子阿\r\n在節骨眼上不計形象的誇\r\n就(會)是最後的贏家\r\nso\r\n所以你懂嗎\r\n現在的樣子\r\n在節骨眼上不計形象的誇\r\n就(會)是最後贏家\r\n\r\n\r\n\r\n', '', 319, '', 'Tzara/Ian', 'Tzara', 'Tzara', 'FLAT CLUB', '', 0, 0, 1, '2008-09-29 03:32:42', '2013-10-07 17:13:00', '0000-00-00 00:00:00'),
(7964, 152, 0, 2, 'Say Hello!!!(冷)', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'Say Hello!!!\r\n曲：Ian&Tzara 詞：Tzara 編曲：FLAT CLUB\r\n\r\n\r\n如今你愣在轉角\r\n十一點鍾座標\r\n再不轉向恐怕船就要觸礁\r\n\r\n\r\n所以別投鼠忌器\r\n自顧不瑕緊張\r\n扭扭捏捏結結巴巴語焉不詳\r\n\r\nSay Hello Honey\r\nSay Hello Baby\r\nSay Hello lovery\r\nSay Hello sweetie\r\n\r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架(自拔)\r\n\r\n(廢話我也不想多嘮叨)\r\n可是你拐彎抹角\r\n面有難色尷尬\r\n欲言又止一點也不瀟灑大方\r\n\r\n\r\n還是想懸崖勒馬\r\n矜持不可自拔\r\n眼高手低吞吞吐吐失措慌張\r\n\r\nSay Hello Honey\r\nSay Hello Baby\r\nSay Hello lovery\r\nSay Hello sweetie\r\n\r\n\r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架(自拔)\r\n\r\n\r\ns\r\n所以你懂嗎\r\n現在的樣子阿\r\n在節骨眼上不計形象的誇\r\n就(會)是最後的贏家\r\nso\r\n所以你懂嗎\r\n現在的樣子\r\n在節骨眼上不計形象的誇\r\n就(會)是最後贏家\r\n\r\n\r\n\r\n', '', 319, '', 'Tzara/Ian', 'Tzara', 'Tzara', 'FLAT CLUB', '', 0, 0, 1, '2008-09-29 04:11:26', '2013-10-07 17:13:00', '0000-00-00 00:00:00'),
(7965, 5643, 0, 2, '倪子崗-絕對無敵', '', '0000-00-00 00:00:00', 0000, 15, 0, 7, '', '', 235, '', '', '', '', '', '', 0, 1, 1, '2008-09-29 13:12:16', '2013-10-07 17:13:00', '0000-00-00 00:00:00'),
(7966, 5642, 0, 2, '雪影', '歌詞暗藏玄機喔\r\n詞:GT天才薇\r\n曲:BS阿帆\r\n鼓:DR扯蛋業\r\n唱:VOC小秘\r\n', '0000-00-00 00:00:00', 0000, 15, 2, 1, '雪融化了春天\r\n影隨形從的海浪\r\n最顯目的時刻\r\n讚揚不絕的想像\r\n\r\n東邊赤熱的夏日\r\n大顯神通的能量\r\n熱血沸騰的旋律\r\n音符脈動的迴盪\r\n\r\n就從現在開始 \r\n搖滾無限張揚\r\n渾然天成的傲慢 \r\n就是這樣\r\n\r\n熱熱烈列 盡情吶喊 \r\n舞台魅力肆放\r\n不眠不休 全副武裝 \r\n展現自信狂妄\r\n\r\n瘋狂在極限方向 \r\n溼透了我的偽裝\r\nDon''t ask me why\r\n麻煩滾到一旁\r\n\r\nJust enjoy power chord\r\nCould u hear fuzz tone\r\nHow about playing up stroke\r\nMusic''s around the world \r\n', '', 278, '', 'BS~帆', 'GT~Finy', '雪影', 'SS', '', 0, 1, 0, '2008-09-29 13:44:36', '2015-03-12 13:34:21', '0000-00-00 00:00:00'),
(7967, 5642, 0, 1, '小偷', '難得一件抒情歌\r\n詞:GT天才薇\r\n曲:BS阿帆\r\n鼓:DR扯蛋業\r\n唱:VOC小秘\r\n', '0000-00-00 00:00:00', 0000, 15, 2, 4, '我的心被偷竊\r\n空盪盪只剩思念\r\n延遲了一分鐘\r\n過了報案的有效期限\r\n\r\n我的心已淪陷\r\n你的姿態很搶眼\r\n紳士的道個歉\r\n要我優雅的忘了一切\r\n\r\n我不在上流社會\r\n也不是上流美\r\n你看上我哪一點\r\n任意主宰我的喜與悲\r\n\r\n表演高貴的情操\r\n卑微的很可憐\r\n你破壞所有防備\r\n要我坦承愛情都是罪\r\n\r\n你走 讓你走\r\n我會眼睜睜讓你走\r\n這個世界已經太多虛偽\r\n沒有誰是誰非誰錯誰對\r\n有一天小偷也會遇上賊\r\n\r\n', '', 255, '', 'BS~帆', 'GT~Finy', '雪影', 'SS', '', 0, 1, 0, '2008-09-29 14:50:26', '2015-03-12 13:34:21', '0000-00-00 00:00:00'),
