(8135, 1908, 967, 1, 'A PIE IN THE SKY', '', '2008-08-23 00:00:00', 0000, 35, 0, 4, '晨曦下那道陽光\r\n把我照亮\r\n在那熟悉小弄巷\r\n\r\n微亮\r\n準備要起床\r\n想起那夢想  它開始的地方\r\n\r\n無法停止的方向\r\n向前追吧  A PIE IN THE SKY\r\n\r\n無法往回的力量\r\n向前追吧  A PIE IN THE SKY\r\nWILL BE COME TRUE', '', 144, '', 'MEGI', 'MEGI', 'TEENS EDGE', '馭音房錄音室', '', 0, 0, 1, '2008-10-04 00:24:46', '2013-10-07 17:13:02', '0000-00-00 00:00:00'),
(8136, 1908, 967, 2, 'HOLY NEW LIFE', '', '2008-08-23 00:00:00', 0000, 35, 0, 4, 'This isn''t just the end for us\r\nIt''s also a new begin\r\nTo me to you to all of us\r\nCan you just close your eyes\r\n\r\nI still can''t belive\r\nWhy me walk on different path\r\nand we didn''t notice\r\n\r\nOpen your heart\r\nOpen your mind\r\nI wish I can have a holy new life\r\n\r\nListen to me carefully\r\nMaybe it''s the last word\r\nDid you ever seen a story\r\nWithout happy ending\r\n\r\nI still can''t belive\r\nWhy we walk on different path\r\nand we didn''t notice\r\n\r\nOpen your heart\r\nOpen your mind\r\nI wish I can have a holy new life', '', 217, '', 'MEGI', 'MAY', 'TEENS EDGE', '馭音房錄音室', '', 0, 0, 1, '2008-10-04 00:33:05', '2013-10-07 17:13:02', '0000-00-00 00:00:00'),
(8137, 1908, 967, 3, '青鳥', '', '2008-08-23 00:00:00', 0000, 35, 0, 4, '徘徊在十字路口  擦肩而過的人頭\r\n怎麼都帶著憂愁  壓力沒出口\r\n\r\n衷於自己的活著\r\n也能帶給別人幸福嗎\r\n\r\n展翅飛向灰濛濛的天\r\n想衝破命運的鎖鍊\r\n說不定  有哪一天\r\n會有誰  因為我  改變\r\n\r\n趕快甩掉那藉口\r\n衷於自我不需要理由\r\n\r\n展翅飛向灰濛濛的天\r\n想衝破命運的鎖鍊\r\n說不定  有哪一天\r\n會有誰  因為我  改變', '', 170, '', 'MEGI', '高曼芸', 'TEENS EDGE', '馭音房錄音室', '', 0, 0, 1, '2008-10-04 00:34:45', '2013-10-07 17:13:02', '0000-00-00 00:00:00'),
(8138, 5642, 0, 1, '一秒鐘', '搖滾一秒鐘\r\n詞:Finy\r\n曲:帆\r\ndrum:大業\r\n演唱:小秘\r\n', '0000-00-00 00:00:00', 0000, 15, 2, 4, '完美的遊戲\r\n差不多已經玩膩\r\n下一關是否還能繼續\r\n考驗彼此智慧和耐力\r\n\r\n震撼的謎題\r\n一瞬間破解完畢\r\n這一場賭注決定致命\r\n鬆懈緊繃情緒和呼吸\r\n\r\nYOU ARE MY HARD CANDY\r\nJUST HAVE FUN AND INTERESTING\r\nONE DAY I WILL CHANGE\r\nCHANGE ALL OF MY LIFE READY\r\n\r\n這一秒鐘\r\n享受了夏季\r\n為你落下了咒語 \r\n封閉在心裡\r\n\r\n唯一秒鐘\r\n看清了自己\r\n為你解開了晨曦\r\n劃破了冬季\r\n\r\n不要捨不得\r\n不要看不懂\r\n不要無聲承受\r\n不要輕易淚流\r\n', '', 229, '', '帆', 'Finy', '雪影', 'SS', '', 0, 1, 0, '2008-10-05 05:33:23', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
