(8142, 2881, 969, 1, 'SAYONARA', '', '2008-08-01 00:00:00', 0000, 20, 0, 1, '陪伴左右的夢還在  相信你已經看到前方的未來\r\n時間都要停擺  大聲把不開心的話通通說出來\r\n\r\n啊~~啦  \r\n搭啦搭搭搭\r\n\r\n過去的時間不會重來  對著發抖的事說掰掰\r\nsayonara  就是現在  瞄準太陽的方向  快\r\n\r\n跌倒了還是要站起來  不允許輕易的被打敗\r\nsayonara  就是現在  讓灰心淪陷在昨天吧\r\n\r\n令人頭痛的事擺著高姿態\r\n牽著你的手 不會躲開  一起 fight !', '', 202, '', 'Vina', 'Vina', 'Vina', '獨立', '', 0, 1, 0, '2008-10-06 16:06:34', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
(8143, 2881, 969, 2, '跨越', '', '2008-08-01 00:00:00', 0000, 20, 0, 1, '短短這一秒的結束\r\n另一端已開始的路\r\n也許都由不得  你遲疑反反又覆覆\r\n我說你想要的幸福\r\n需要你全心全力的\r\n也許才有可能 抓的住別怕輸\r\n\r\n終點之前  無法掌握的變數\r\n點綴了最初  最期待的旅途\r\n\r\n大步大步走吧 踩著腳下的泥巴和沙\r\n有什麼好懼怕 堅持你的想法\r\n咬牙快爆炸 驕傲的發芽\r\n就跨越吧 用決心期待著呀\r\n期待著的光 變化成輝煌\r\n\r\n握著無人能敵的態度\r\n有多麼的義無反顧\r\n用力擺脫束縛  自己是自己最清楚\r\n現在看的見未來嗎\r\n心卻像鑽石般堅固\r\n來放手一搏吧 撐得住別怕輸', '', 261, '', 'Vina', 'Vina', 'Vina', '', '', 0, 1, 0, '2008-10-06 16:10:39', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
(8144, 2881, 969, 3, '小孩與木馬', '', '2008-08-01 00:00:00', 0000, 20, 0, 4, '旋轉的木馬\r\n燈光多閃亮\r\n卻只能在原地跑呀\r\n\r\n我坐上了牠\r\n跟著轉呀轉\r\n我也在原地跑呀\r\n\r\n沿著繽紛閃耀的軌道\r\n我喜歡這樣的喧鬧\r\n帶著木馬一起去尋找\r\n長不大的小孩   好不好', '', 108, '', 'Vina', 'Vina', 'Vina', '', '', 1, 1, 0, '2008-10-06 16:13:59', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
