(8146, 5642, 0, 1, '不值得', '唱:小秘\r\nGT:Finy\r\nBS:帆\r\n鼓:大業\r\n', '0000-00-00 00:00:00', 0000, 15, 2, 1, '勉強去笑著\r\n說服自己一切沒改變\r\n心懸在那頭\r\n就好像亂無思緒墜入深淵\r\n\r\n夜垂的深\r\n那泛黃的回憶在心中多甜美\r\n能不能一直沉睡\r\n\r\n他值不值得\r\n有人為他流淚為他心碎\r\n愛情從來都不能有一點點 缺陷\r\n\r\n被刺痛的靈魂終究應 \r\n該清醒早已傷痕累累 \r\n就算會讓人生命失去意義\r\n\r\n雨下得好大\r\n天空一片灰暗\r\n心遊蕩得好空\r\n思緒一陣混亂\r\n\r\n猜不透他眼神\r\n透露一絲後悔\r\n猜不透我嘴角\r\n含著原諒抱歉\r\n\r\n', '', 252, '', 'BS 帆', 'GT Finy', '雪影', 'SS', '', 0, 1, 0, '2008-10-07 04:09:32', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
