(8148, 5642, 0, 1, '殺手', 'high\r\n唱:小秘\r\nGT:Finy\r\nBS:帆\r\n鼓:大業', '0000-00-00 00:00:00', 0000, 15, 2, 1, '狂奔\r\n及時追上你的體溫\r\n冰冷\r\n隱伏著奪命的靈魂\r\n\r\n隱身\r\n黑暗裡埋葬了心疼\r\n氣氛\r\n啃食著午夜和清晨\r\n\r\n當自己是虛無\r\n聖潔的無辜\r\n儘管多麼無助\r\n也不想認輸\r\n\r\n危險的空城\r\n愛情會擾亂一切的矜持\r\n萬物捨棄只有一個忍\r\n不能重蹈覆轍 \r\n向下沉倫\r\n\r\n叛逆的分子\r\n重疊的身影將大地吞噬\r\n決定勝負只有一個人\r\n心痛衝擊的深 \r\n不能承認\r\n\r\n讓我狂奔 狂奔 狂奔\r\n讓我冰冷 失去 體溫\r\n\r\n\r\n', '', 268, '', 'BS 帆', 'GT Finy', '雪影', 'SS', '', 0, 1, 0, '2008-10-07 07:17:28', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
