(8153, 5609, 948, 4, '04 The Losing End-最終', 'A song about being dumped. Not much meaning any more…just a song we like to jam.\r\n這首抒情失戀情歌，特別是專輯裡有好友“瘋子(前亂彈吉他手)”的一段獨奏，為這首歌加入不同的感覺。\r\n', '2008-09-02 00:00:00', 0000, 9, 0, 5, 'I sit alone here in the afternoon, I think of you / And feeling bad, it makes me sad to see that we might be through / The problem is, and its really quite ironic, I do think / As we get closer we get further away / You were a dream come true, a fairytale, I fell for you / I thought that everything would work out right / But then the change came on so strong / Everything went wrong / November found me on the losing end again / One day back in August, I put a ring upon your finger / And in return, you went and you put me through the wringer / In spite of that I still wanted you back ‘cause I couldn’t stand losing you / I didn’t want to be your memory', '', 233, '', 'Jason Grenier', 'Jason Grenier', 'Jason Grenier', '喜瑪拉雅', '', 0, 1, 0, '2008-10-07 19:31:17', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
(8154, 5609, 948, 7, '07. Be Alright-終將無恙', 'Life is short, and it’s hard to be passionate enough to live each day to the fullest. This is a love song. It’s a song about hope, too.\r\n “如果我只剩下三天，一天與你相聚就已足夠，坐在客廳和你一起靜靜聽著雨聲……”人生短暫，很難每天都充滿熱情的過日子，歌詞非常有趣的呈現出兩種意境，是一首情歌，也是關於希望。\r\n', '2008-09-02 00:00:00', 0000, 9, 0, 5, 'Live each day as if it were your last one, I’ve heard people say / And I agree with the sentiment, but how the hell do you keep up the intensity day after day? / Sometimes I feel inspired / Sometimes I just feel tired / Work to do and bills to pay, and sometimes time just slips away / Everything’s gonna be alright / Everything’s gonna be alright / Everything’s gonna be alright / If I knew I only had three days left, I’d lay them out like beads in the sun / And I would trade away two, if it meant that I could be with you for one / One would be enough for me, knowing that you felt the same / Hanging out with you at home / No one talking, just the sound of the rain falling / Everything’s gonna be alright / Everything’s gonna be alright / Everything’s gonna be alright', '', 241, '', 'Jason Grenier', 'Jason Grenier', 'Jason Grenier', '喜瑪拉雅', '', 0, 1, 0, '2008-10-07 20:31:21', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
(8155, 5609, 948, 8, '08. Oh, My Darling Boy-摯愛吾兒', '', '2008-09-28 00:00:00', 0000, 9, 0, 5, '', '', 261, '', 'Jason Grenier', 'Jason Grenier', 'Jason Grenier', '', '', 0, 1, 0, '2008-10-07 20:36:10', '2015-03-12 13:34:27', '0000-00-00 00:00:00'),
(8156, 3151, 841, 4, '两个人的房间', '', '2009-02-14 00:00:00', 0000, 15, 0, 4, '从这里到视线尽头 是两个人的距离\r\n天花板反射的光 穿透你的身体\r\n眼睛合上 影像残存\r\n你默默无语 将我囚禁\r\n\r\n我已经忘了 窗外也有风景\r\n地上飘散着 撕下张张日历\r\n我在你眼里 寻找失落的记忆\r\n你在我眼里 看到封存的秘密\r\n\r\n两个人的房间 寂寞的风来回地吹\r\n两个人的心里 自己坐在自己的世界\r\n两个人的房间 暗淡的生命悄然流逝\r\n两个人的心里 再也装不下对方的孤寂\r\n\r\n玻璃杯碎了 停留清脆的声音\r\n电视机开着 没人认真去注意\r\n点燃蜡烛 看火焰死去\r\n轻碰触嘴唇 礼貌地拒绝了吮吸\r\n\r\n两个人的房间\r\n两个人的心里\r\n两个人的房间\r\n寂寞的风来回地吹 ', '', 246, '', '林笛', '林笛', '林笛', '', '', 0, 1, 0, '2008-10-07 21:50:57', '2015-03-12 13:34:27', '0000-00-00 00:00:00');
